import React from 'react';
import Card from './Card';

export default function Discover({ movieslist }) {

    return (
        <div className='dis-cont'>
        <h2>Moviled</h2>
            {
                movieslist.map((movie, index) => (
                    <div key={index}>
                        <h3>{movieslist.title}</h3>
                    </div>
                ))
            }
        </div>
    )
}
